package irmaoverflow.emoji.bot;

import com.google.api.client.repackaged.org.apache.commons.codec.binary.Base64;
import okhttp3.*;
import org.json.JSONObject;
import java.io.File;
import java.io.FileInputStream;

public class EmojiUpload {
    String guildID;
    File img;
    String url;
    String imageString;

    EmojiUpload(File image, String id) {
        img = image;
        guildID = id;
        url = "https://discordapp.com/api/guilds/" + guildID + "/emojis";
    }
    public void sendEmojiRequest() {
        JSONObject obj = new JSONObject();
        try {
                FileInputStream fileInputStreamReader = new FileInputStream(img);
                byte[] bytes = new byte[(int)img.length()];
                StringBuilder sb = new StringBuilder();
                sb.append("data:image/jpeg;base64,");

                fileInputStreamReader.read(bytes);
                sb.append(new String(Base64.encodeBase64(bytes), "UTF-8"));
                //sb.append("");
                imageString = sb.toString();
                System.out.println(imageString);

                sendPost(obj);
        }
        catch(Exception e) {
            System.out.println("Byte conversion failed");
        }

    }
    private void sendPost(JSONObject obj) throws Exception {
        OkHttpClient client = new OkHttpClient();
        //String hard = "data:image/jpeg;base64,";
        MediaType mediaType = MediaType.parse("application/json");
        String bodystr = String.format("{\"name\": \"James\",\"image\": \"%s\"}", imageString);
        RequestBody body = RequestBody.create(mediaType, bodystr);
        Request request = new Request.Builder()
                .url("https://discordapp.com/api/guilds/490352653612744707/emojis")
                .post(body)
                .addHeader("cookie", "__cfduid=d6e157e16c5a98b7dc4157c495bea28f11537073072")
                .addHeader("authorization", "Bot NDkwNTY1MTA0OTIwOTUyODUz.Dn9wfg.Ir3GOBntjQg3Ci05eGiStOTk3Tw")
                .addHeader("user-agent", "emojiBot (http://www.github.com/RandyT97, v0.1)")
                .addHeader("content-type", "application/json")
                .build();

        Response response = client.newCall(request).execute();
        System.out.println(response.body());
    }

}

